LoungeSimple Mongoose-inspired ODM for Couchbase.
Installationnpm install loungeNode.js >= 0.10 supported. For Node.js versions node with the harmony --harmony and harmony proxies --harmony_proxies flags. For Node.js version >= 6.0 no special flags are needed.OverviewLounge is a simple, somewhat opinionated, Mongoose-inspired ODM for Couchbase. Main goal is
to provide modeling tool framework for working with Couchbase databases in an asynchronous environment of Node.js.var lounge = require('lounge');
lounge.connect({
  connectionString: 'couchbase://127.0.0.1',
  bucket: 'lounge_test'
});

var schema = lounge.schema({ name: String });
var Cat = lounge.model('Cat', schema);

var kitty = new Cat({ name: 'Zildjian' });
kitty.save(function (err) {
  if (err) // ...
  console.log('meow');
});
FeaturesSchema definition

Strict modeling based on schema

Schema extension

Automatic type validation and custom validation

Document upsert and removal

Embedded (referenced) documents

Automatic and manual population of embedded (referenced) document

Middleware including pre and post hooks

Indexing using reference lookup documents

Promise support

Outside of the scope of this moduleDocument and view management. There are too many patterns and ways of performing document and view management and
view lookup that it is impractical to accommodate anything sane within a simple ODM. This can easily be expanded
on top of Lounge.

View queries. For same reasons this falls outside of the scope of Lounge.

Automatic document removal on key change. That is if a document key property changes, the new document is saved under
the new key. The old document sticks around under the old key. There are too many implications if we start automatically
handling document removal in this scenario. This should be handled by the user of this module. In most use cases this
should not really be an issue.

modeling.html.body:
Modeling BasicsWe begin defining a data model using a schema.var userSchema = lounge.schema({
  firstName: String,
  lastName: String,
  age: Number,
  usernames: [String],
  setup: Boolean
  metadata: {
    createdAt: Date,
    updatedAt: Date
  }
});
We can add additional properties using add function:userSchema.add('name', String);
Alternatively we can explicitly specify the type using type property:var catSchema = lounge.schema({
  name: { type: String }
  breed: String,
});

catSchema.add('age', {type: String});
Schema options can be set at construction or using the set function.var catSchema = lounge.schema({
  name: { type: String }
  breed: String,
});

catSchema.set('minimize', false);
One a schema is defined we need to generate the model class using the model method.var Cat = lounge.model('Cat', catSchema);

var myCat = new Cat({
  name: 'Felicette',
  breed: 'Tabby'
});

console.log(myCat);
We can get an already generated model class using
getModel method.var Cat = lounge.getModel('Cat');

var cat2 = new Cat({
  name: 'Babou',
  breed: 'Ocelot'
});

console.log(cat2);
console.log(cat2.modelName); // Cat
Document keysBy default schemas come with an id property as the document key, and the automatically generated value will be
a UUID
using node-uuid v4() function. This should be most practical and
appropriate in a lot of cases. Alternatively you can specify explicit key properties:var userSchema = lounge.schema({
  firstName: String,
  lastName: String,
  email: { type: String, key: true, generate: false }
});
Here we desire email to be used as the document key and we specify generate: false because we do not want Lounge
to automatically handle key property value generation. If we still want uuid generation but in a different property
we can specify so:var userSchema = lounge.schema({
  firstName: String,
  lastName: String,
  email: String,
  userId: {type: String, key: true, generate: true }
});
generate does not have to be set explicitly to true as that is the default.We can specify additional prefix and/or suffix for keys. This will be used when wrigin to the database as the actual
document key.var userSchema = lounge.schema({
  firstName: String,
  lastName: String,
  email: { type: String, key: true, generate: false, prefix: 'user'}
});
Note that setting prefix and suffix options like this will take presidence over any keyPrefix and keySuffix
options specified in the second options parameter to the schema() call or any settings in the lounge config.Examplesvar lounge = require('lounge');

// ... connect

var userSchema = lounge.schema({
  name: String
  email: { type: String, key: true, generate: false, prefix: 'user::'}
});

var User = lounge.model('User', userSchema);
var user = new User({name: 'Bob Smith', email: 'bsmith@acme.com'});
user.save();
This will save the user document under key user::bsmith@acme.com.var lounge = require('lounge');

// ... connect

var userSchema = lounge.schema({
  name: String
}, {
  keyPrefix: 'user::'
});

var User = lounge.model('User', userSchema);
var user = new User({name: 'Bob Smith'});
user.save();
This will automatically generate a uuid id property and save the user document under key
similar to user::110ec58a-a0f2-4ac4-8393-c866d813b8d1.Data manipulationData in Model instances can be access directly or using get function. Similarly it can be manipulated using
either assignment operator or using the set function. In either case the input value is validated to be of proper type.var userSchema = lounge.schema({
  name: String
  friends: Number,
  dob: Date,
  setup: Boolean
});

var User = lounge.model('User', userSchema);
var user = new User({name: 'Bob Smith'});

user.get('name'); // 'Bob Smith'
user.name = 'Joe'; // OK
user.name.set('Joe'); // OK
console.log(user.name); // 'Joe'
user.set('friends', 20); // OK
user.friends = 'abc'; // nope. still 20
user.dob = new Date('July 5, 1980');
user.get('dob'); // instance of Date
user.set('setup', 'yup'); // nope
user.setup = true; // OK
ValidationLounge does automatic validation against input data using the type information specified in the schema definition.
We can provide custom validation in schema definition by providing validator function.var validator = require('validator'); // Node validator module

var userSchema = lounge.schema({
  name: String
  email: {type: String, validate: validator.isEmail}
});

var User = lounge.model('User', userSchema);
var user = new User({ name: 'Bob Smith' });

user.email = 'bob@gmail.com'; // OK
user.email = 'bsmith'; // Nope
console.log(user.email); // 'bob@gmail.com'
VirtualsVirtuals are document properties that you can get and set but that do not get persisted to the database.
The getters are useful for formatting or combining fields, while setters are useful for de-composing a single value
into multiple values for storage.var userSchema = lounge.schema({
  firstName: String,
  lastName: String
});

userSchema.virtual('fullName', {
  get: function () {
    return this.firstName + ' ' + this.lastName;
  },
  set: function (v) {
    if (v !== undefined) {
      var parts = v.split(' ');
      this.firstName = parts[0];
      this.lastName = parts[1];
    }
  }
});

var User = lounge.model('User', userSchema);
var user = new User({firstName: 'Bob', lastName: 'Smith'});
console.log(user.fullName); // Bob Smith
user.fullName = 'Jim Jones';
console.log(user.fullName); // Jim Jones
console.log(user.firstName); // Jim
console.log(user.lastName); // Jones
If no set function is defined the virtual is read-only.StaticsAdding static methods to Models can be accomplished using static() schema functionvar userSchema = lounge.schema({
  firstName: String,
  lastName: String
});

userSchema.static('foo', function(p, q) {
  return p + q;
});

var User = lounge.model('User', userSchema);
User.foo(1, 2); // 3
We can also pass an object of function keys and function values, and they will all be added.MethodsSimilarly adding instance methods to Models can be done using method() schema function.var userSchema = lounge.schema({
  firstName: String,
  lastName: String
});

userSchema.method('fullName', function() {
  return this.firstName + ' ' + this.lastName;
});

var User = lounge.model('User', userSchema);
var user = new User({firstName: 'Bob', lastName: 'Smith'});
user.fullName(); // 'Bob Smith'
We can also pass an object of function keys and function values, and they will all be added.init() methodThere is a special init method that if specified in schema definition will be called at the end of model creation.
You can do additional setup here. This method is not passed in any arguments.toObject()Model instances come with toObject function that is automatically used for console.log inspection.Options:transform - function used to transform an object once it's been converted to plain javascript representation from a
model instance.

minimize - to "minimize" the document by removing any empty properties. Default: true

virtuals - to apply virtual getters

serializable - whether to include serializable properties. Default: true

dateToISO - convert dates to string in ISO format using Date.toISOString(). Default: true

These settings can be applied on any invocation of toObject as well they can be set at schema level.var userSchema = lounge.schema({
  name: String,
  email: String,
  password: String
});

var xform = function (doc, ret, options) {
  delete ret.password;
  return ret;
};

userSchema.set('toObject', {transform: xform});

var User = lounge.model('User', userSchema);

var user = new User({
  name: 'Joe',
  email: 'joe@gmail.com',
  password: 'password'
});

console.log(user); // { name: 'Joe', email: 'joe@gmail.com' }
toJSON()Similar to toObject. The return value of this method is used in calls to JSON.stringify.CASAll document instances have a read-only property cas that returns the string representation of the CAS object retrieved
from the database. The cas property is initialized only once a document has been retrieved from the database using one
of query functions, or once it has been saved. Alternatively we can use the method getCAS(raw) to get the cas value.
If raw is true then we return the raw CAS object. Otherwise we return string representation. This can be useful
for computation of ETag values for example.console.log(doc.cas); // String: 00000000a71626e4
console.log(doc.getCAS()); // String: 00000000a71626e4
console.log(doc.getCAS(true)); // Object: CouchbaseCas
Useful member variablesAll model instances come with a modelName read only property that you can use to access the model name. As well
instances have schema property that represents the models schema used when creating the model with model() function.var userSchema = lounge.schema({
  name: String,
  email: String
});

var User = lounge.model('User', userSchema);
var user = new User({name: 'Bob Smith'});

console.log(user.modelName); // 'User'
console.log(user.schema instanceof lounge.Schema); // true
ErrorsWhen setting a value fails, an error is generated silently. Errors can be retrieved with getErrors() and cleared with clearErrors().var schema = new lounge.schema({
  id: {type: String, minLength: 5}
});

var Profile = lounge.model('Profile', schema);

var profile = new Profile();
profile.id = '1234';

console.log(profile.hasErrors()); // true

console.log(profile.getErrors());

// Prints:
[ { errorMessage: 'String length too short to meet minLength requirement.',
    setValue: '1234',
    originalValue: undefined,
    fieldSchema: { name: 'id', type: 'string', minLength: 5 } } ]

// Clear all errors.
profile.clearErrors();

types.html.body:
Types Supported types:String

Number

Boolean

Date

Array (including types within Array)

Object (including typed Models for sub-schemas)

'any'

When a type is specified, it will be enforced. Typecasting is enforced on all types except 'any'. If a value cannot be typecasted to the correct type, the original value will remain untouched.Types can be extended with a variety of attributes. Some attributes are type-specific and some apply to all types.Custom types can be created by defining an object with type properties.var NotEmptyString = {type: String, minLength: 1};
country: {type: NotEmptyString, default: 'USA'}
General attributestransform
Called immediately when value is set and before any typecast is done.name: {type: String, transform: function(value) {
  // Modify the value here...
  return value;
}}
validate
Called immediately when value is set and before any typecast is done. Can be used for validating input data.
If you return false the write operation will be cancelled.name: {type: String, validate: function(value) {
  // check
  return value;
}}
default
Provide default value. You may pass value directly or pass a function which will be executed when the object is initialized. The function is executed in the context of the object and can use "this" to access other properties (which .country: {type: String, default: 'USA'}
get
Provide function to transform value when retrieved. Executed in the context of the object and can use "this" to access properties.string: {type: String, get: function(value) { return value.toUpperCase(); }}
readOnly
If true, the value can be read but cannot be written to. This can be useful for creating fields that reflect other values.fullName: {type: String, readOnly: true, default: function(value) {
  return (this.firstName + ' ' + this.lastName).trim();
}}
invisible
If true, the value can be written to but isn't outputted as an index when toObject() is called.
This can be useful for hiding internal variables.serializable
By default all values defined in the schema except those that are set to invisible using the property above are written
to the database when the document is saved. If this property is set to false, the value can be written to and can be
read and will be visible using toObject and toJSON methods but is not written when model is saved to the database.
This can be useful when you need some "working" properties that you never want to serialized but otherwise passed around
and visible.StringstringTransform
Called after value is typecast to string if value was successfully typecast but called before all validation.postalCode: {type: String, stringTransform: function(string) {
  // Type will ALWAYS be String, so using string prototype is OK.
  return string.toUpperCase();
}}
regex
Validates string against Regular Expression. If string doesn't match, it's rejected.memberCode: {type: String, regex: new RegExp('^([0-9A-Z]{4})$')}
enum
Validates string against array of strings. If not present, it's rejected.gender: {type: String, enum: ['m', 'f']}
minLength
Enforces minimum string length.notEmpty: {type: String, minLength: 1}
maxLength
Enforces maximum string length.stateAbbrev: {type: String, maxLength: 2}
clip
If true, clips string to maximum string length instead of rejecting string.bio: {type: String, maxLength: 255, clip: true}
Numbermin
Number must be > min attribute or it's rejected.positive: {type: Number, min: 0}
max
Number must be negative: {type: Number, max: 0}
Arrayunique
Ensures duplicate-free array, using === to test object equality.emails: {type: Array, unique: true, arrayType: String}
arrayType
Elements within the array will be typed to the attributes defined.aliases: {type: Array, arrayType: {type: String, minLength: 1}}
An alternative shorthand version is also available -- wrap the properties within array brackets.aliases: [{type: String, minLength: 1}]
ObjectobjectType
Allows you to define a typed object.company: {type: Object, objectType: {
  name: String
}}
An alternative shorthand version is also available -- simply pass a descriptor.company: {
  name: String
}
Aliastarget (required)The target key of the property being aliased.zip: String,
postalCode: {type: 'alias', target: 'zip'}
// this.postalCode = 12345 -> this.toObject() -> {zip: '12345'}

middleware.html.body:
Middleware Similar to Mongoose middleware, Lounge exposes pre and post hooks.
Normally this is used to do additional validation pre save, and cleanup post document removal. Although the hooks can be
setup for any method including toObject and toJSON methods.var userSchema = lounge.schema({
  firstName: String,
  lastName: String,
  email: String
});

userSchema.pre('save', function (next) {
  if (this.email) {
    this.email = this.email.toLowerCase();
  }

  // we must call next to continue control flow
  next();
});

userSchema.post('remove', function () {
  console.log('document %s removed', this.id);
});
Important note here is that post 'save' and 'remove' hooks do not receive any form of control flow. There are no
callbacks passed.The callback passed into pre hooks can be used to control flow of logic and execution:schema.pre('save', function (next) {
  // some custom validation method
  if (!this.validate()) {
    return next(new Error('Validation error!'));
  }

  next();
});

// elsewhere...

doc.save(function(err, savedDoc) {
  if(err) console.log(err); // 'Validation error!' Document was not saved
});
onBeforeValueSet(key, value) / onValueSet(key, value)onBeforeValueSet / onValueSet allow you to bind an event handler to all write operations on an object.
Currently, it will only notify of write operations on the object itself and will not notify you when child objects are
written to. If you return false or throw an error within the onBeforeValueSet handler, the write operation will be
cancelled. Throwing an error will add the error to the error stack.var User = lounge.schema({ name: String }, {
  onBeforeValueSet: function(key, value) {
    if(key === 'name' && value.indexOf('Joe') === -1) {
      return false;
    });
  }
});

var User = lounge.model('User', schema);
var user = new User();
user.name = 'Bill'; // { name: undefined }
user.name = 'Joe Smith'; //  { name: 'Joe Smith' }

extend.html.body:
Schema Extension It is useful to have a common base schema, that all other schemas / models would extend or "inherit" properties from.
This can be accomplished by using the Schema.extend function. When used all properties, virtuals,
methods, statics, and middleware that are present in the base schema but not present in destination schema are copied
into the destination schema. var baseSchema = lounge.schema({
  metadata: {
    doc_type: String,
    createdAt: Date,
    updatedAt: Date
  }
});

baseSchema.pre('save', function (next) {
  if (!this.metadata) {
    this.metadata = {};
  }

  var now = new Date();

  if (!this.metadata.createdAt) {
    this.metadata.createdAt = now;
  }

  this.metadata.updatedAt = now;
  this.metadata.doc_type = this.modelName;

  next();
});

baseSchema.method('baseFoo', function () {
  console.log('base foo');
});

var userSchema = lounge.schema({
  name: String,
  email: String,
});

userSchema.pre('save', function (next) {
  if (this.email) {
    this.email = this.email.toLowerCase();
  }

  next();
});

userSchema.method('userFoo', function () {
  console.log('user foo');
});

// make user schema extend the base schema
userSchema.extend(baseSchema);
var User = lounge.model('User', userSchema);

user = new User({
  name: 'Bob Smith',
  email: 'BSmith@gmail.com'
});

user.baseFoo() // prints 'base foo'
user.userFoo() // prints 'user foo'

user.save(function(err, savedDoc) {
  console.log(user.metadata.updatedAt); // Sat Dec 29 2015 03:30:00 GMT-0400 (AST)
  console.log(user.metadata.doc_type); // 'user'
  console.log(user.email); // 'bsmith@gmail.com'
});

embedded.html.body:
Embedded Documents Lounge allows for embedding and referencing other Models within schema.var addressSchema = lounge.schema({
  street: String,
  city: String,
  country: String
});

var Address = lounge.model('Address', addressSchema);

var blogPostSchema = lounge.schema({
  title: String,
  body: String,
});

var BlogPost = lounge.model('BlogPost', blogPostSchema);

var userSchema = lounge.schema({
  name: String,
  address: Address,
  posts: [BlogPost]
});

var post = new BlogPost({
  title: 'Foo',
  body: 'Lorem ipsum'
});

var user = new User({
  name: 'Bob Smith',
  posts: [post],
  address: new Address({
    street: '123 Fake Street',
    city: 'Springfield',
    country: 'USA'
  })
});

user.posts.push(new BlogPost({
  title: 'Post 2',
  body: 'Some more text!'
});
You can manipulate and work with subdocument just like any model instances. When the top level document is saved
all child subdocuments are saved as well. Subdocuments must be an instance of the Model defined in the schema or a
String in which case it represents the key / id of the subdocument.If needed we can also specify embedded document type of a model that is not defined yet. For example:var siteSchema = lounge.schema({
  owner: {type: lounge.Model, modelName: 'User'},
  url: String
});

var Site = lounge.model('Site', siteSchema);

var userSchema = lounge.schema({
  email: String,
  name: String
});

var User = lounge.model('User', userSchema);

var user = new User({
  name: 'Joe Smith',
  email: 'jsmith@gmail.com'
});

var site = new Site({
  url: 'http://wwww.mysite.org',
  owner: user
});

docops.html.body:
Document Operations Saving Documents Saving documents is done using save function that every model instance has. This will execute all pre
'save' middleware and then perform Couchbase upsert operation on any subdocuments and the actual document. It will also
perform lookup document updates and finally execute any post hook middleware.From our example code above:user.save(function(err, savedDoc) {
  if(err) console.log(err);
});
All documents and subdocuments would be upserted into the database.Model.save(data, options, fn)data - any data to be set into the model before saving.optionsAll options not present here are first looked up from schema options, and then from config options.storeFullReferenceId - whether to save embedded document property values as full document keys or just the base value

storeFullKey - whether to save the internal document key property as fully expanded value or as the simple value

refIndexKeyPrefix - lookup index document key prefix.

waitForIndex - whether we want to wait for indexing to finish before returning. default is false.

virtuals - whether we want to save virtuals. default is false.

minimize - to "minimize" the document by removing any empty properties. Default: true

expiry - couchbase upsert option

persist_to - couchbase persist_to option

replicate_to - couchbase option

Getting Documents All models created come with a static function findById that can be used to look up a single or multiple keys and
retrieve documents from the database. If key does not exist and document is not found we do not return an error
but also no model is generated. This is different than present couchbase module behaviour.User.findById('user123', function(err, doc) {
  if(err) console.log(err); // there was an error looking up the key
  else if(!doc) console.log('no document found');
  else console.log(doc); // doc is instance of User and will print it out
});
We can get multiple keys using an array as the first parameter. In this case, the callback invoked is passed 3 arguments
in form (err, documents, misses).User.findById(['user123', 'user456'], function(err, docs, misses) {
  if(err) console.log(err); // there was an error looking up the key
  console.dir(docs);        // array of Users found
  console.dir(misses);      // array if keys not found.
});
When findById is invoked using a single string argument the result returned is a single model instance. When an array
is passed in we return the results as described above. To force array type of returns in all cases, set the Lounge
config option alwaysReturnArrays to true. Default is false.By default order of the generated objects in an array result is not guaranteed to be the same order as the ids queried.
To keep the order of the returned model instances the same as the ids set keepSortOrder option to true.By default the findById and index query functions return 3 parameters to the callback in form (err, docs, missing).
If we want to force returning of 2 params at all times (err, docs), and not return the missing parameter, we can
use the missing options either in Lounge settings to set globally, or individually in function invocations. If
missing option is set to false we won't return missing keys as the final param in the callback.lounge.setOption('missing', false);
User.findById(['user123', 'user456'], function(err, docs, misses) {
  if(err) console.log(err); // there was an error looking up the key
  console.dir(docs);        // array of Users found
  console.dir(misses);      // undefined
});
lounge.setOption('missing', false);
User.findById(['user123', 'user456'], { missing: true },function(err, docs, misses) {
  if(err) console.log(err); // there was an error looking up the key
  console.dir(docs);        // array of Users found
  console.dir(misses);      // array of missing keys, as the option in function params takes presidence
});
Removing Documents Removing documents is done using remove function that every model instance has. This will execute all pre
'remove' middleware and then perform Couchbase remove operation. It will also perform lookup document updates
and finally execute any post hook middleware. By default this function does not remove embedded documents. To do
this set removeRefs options to true.user.remove(function(err, doc) {
  if(err) console.log(err);
});
If we want all subdocuments to be removed:user.remove(function(err, {removeRefs: true}, doc) {
  if(err) console.log(err);
});
This will execute removal, hooks and indexing operations for all documents and subdocuments.Models have static remove function that can be used to perform document removal.User.remove('user123', function(err, doc) {
  if(err) console.log(err);
});

population.html.body:
Population findById comes with an options parameter that can have one property populate that can be used to dictate
if and how we want to get any embedded subdocuments from the database. If populate option is true all embedded
subdocuments are retrieved from the database.From our "Embedded Documents" example, if we were to retrieve the user document created:User.findById(userId, {populate: true}, function(err, doc) {
  console.log(user instanceof User); // true
  console.log(user.address instanceof Address); // true
  console.log(user.posts[0] instanceof BlogPost); // true

  console.log(user); // full user document with retrieved address and posts subdocuments
});
We can specify a single field to populate:User.findById(userId, {populate: 'address'}, function(err, doc) {
  console.log(user instanceof User); // true
  console.log(user.address instanceof Address); // true
  console.log(user.posts[0] instanceof BlogPost); // false
  console.log(user.posts[0] instanceof String); // true - posts is an array of string keys
});
User.findById(userId, {populate: 'posts'}, function(err, doc) {
  console.log(user instanceof User); // true
  console.log(user.address instanceof Address); // false
  console.log(user.posts[0] instanceof BlogPost); // true
});
Similarly this can also be accomplished by passing { populate: { path: 'address' } } as options.
We can explicitly specify array indexes to populateUser.findById(userId, {populate: 'posts.1'}, function(err, doc) {
  console.log(user instanceof User); // true
  console.log(user.address instanceof Address); // false
  console.log(user.posts[0] instanceof BlogPost); // false
  console.log(user.posts[0] instanceof String); // true
  console.log(user.posts[1] instanceof BlogPost); // true - fully populated
});
Additionally, populate can accept an array if fields to populate:User.findById(userId, {populate: ['address', 'posts.1']}, function(err, doc) {
  console.log(user instanceof User); // true
  console.log(user.address instanceof Address); // true - fully populated
  console.log(user.posts[0] instanceof BlogPost); // false
  console.log(user.posts[0] instanceof String); // true
  console.log(user.posts[1] instanceof BlogPost); // true - fully populated
});
A special use case might be that we want to populate path foo into a target field bar. This can be accomplished by
specifying a target populate option. For example if we have the following models:var profileSchema = lounge.schema({
  firstName: String,
  lastName: String,
  email: String
});

Profile = lounge.model('Profile', profileSchema);

var ticketSchema = lounge.schema({
  confirmationCode: String,
  profileId: Profile,
  profile: Object
});

Ticket = lounge.model('Ticket', ticketSchema);
We can do:Ticket.findById(ticketId, { populate: { path: 'profileId', target:'profile' } }, function(err, ticket) {
  console.log(ticket);
});
Sample output:{ confirmationCode: 'ClqwgiWea',
