indexes.html.body:
Indexes Lounge provides Indexing mechanism using reference lookup documents.
This allows us to set up simple lookups for easier document retrieval where we do not need to do create view
indexes. Specifying an index property is done at schema level:var userSchema = lounge.schema({
  name: String,
  email: { type: String, index: true }
});
Here we wish User models to have their own id as document key, but we want to be able to look up documents via email
as well as that is also unique property for users. Lounge will automatically manage (remove and upsert) lookup documents,
as user is saved or removed.var user = new User({
  name: 'Joe Smith',
  email: 'joe@gmail.com'
});

user.save();
This will create the a lookup document similar to:{ "key": "2ba8a471-063b-420a-aa83-31debe58f46f" }
with document key '$_ref_by_email_joe@gmail.com'. We can manipulate this behaviour using schema options.var userSchema = lounge.schema({
  name: String,
  email: { type: String, index: true }
}, {
  keyPrefix: 'user::',
  delimiter: '::'
});
Saving a document defined with this schema will save user document with key 'user::5c4bfd6d-9c80-452b-be3a-3e528e4f53f5'
and will save a lookup document with key 'user::$_ref_by_email::joe@gmail.com'. Setting refIndexKeyPrefix can add
additional customization.{
  keyPrefix: 'user::',
  delimiter: '::',
  refIndexKeyPrefix: 'lookup_by_'
}
This will result in lookup document key user::lookup_by_email::joe@gmail.com.Indexes can also be arrays:var userSchema = lounge.schema({
  name: String
  usernames: [{ type: String, index: true }]
});
A lookup document will be generated for each value in the array. Index lookup properties have to be of type String or
Number.Index lookup documents are automatically managed by lounge when documents are saved and removed using save() and
remove() functions. You can also manually kick of this process by calling index() function on any model instance.Index queries Any indexed property the Model will automatically get a findBy* static function for easier lookup.
For example code above:var User = lounge.model('User', userSchema);

User.findByEmail('joe@gmail.com', function(err, doc) {
  if(err) console.log(err);
  else console.log(doc);
});
We automatically singularize and camelize property key to derive the index name. So usernames becomes findByUsername.
We can specify the index "name" by passing along the indexName property. For example:var userSchema = lounge.schema({
  name: String
  usernames: [{ type: String, index: true, indexName: 'UN' }]
});

var User = lounge.model('User', userSchema);

User.findByUN('user1', function(err, doc) {
  if(err) console.log(err);
  else console.log(doc);
});
Array index typeIf we can have multiple documents to be indexed by the same value then want the the reference lookup document to
store an array of document keys. This can be accomplished using 'array' indexType.var userSchema = lounge.schema({
  email: { type: String, key: true, generate: false },
  username: { type: String, index: true, indexType: 'array' }
});
Here we really mean that multiple users can have the same nickname and we would like to index both. Example:var user1 = new User({ email: 'bob@gmail.com', nickname: 'bobby' });
var user2 = new User({ email: 'robert@outlook.com', nickname: 'bobby' });
When these two documents are indexed the lookup reference document with the key '$_ref_by_nickname_bobby' would
actually contain the keys to both our documents and would look like:"keys": [
  "bob@gmail.com",
  "robert@outlook.com"
]
Now if we call User.findByNickname('bobby', ...) the result would be 2 User instances. Array index types can be
combined within an array field:var userSchema = lounge.schema({
  email: { type: String, key: true, generate: false },
  usernames: [{ type: String, index: true, indexType: 'array' }]
});
Indexing on embedded documentsFinally, indexing can be accomplished on embedded documents.var companySchema = lounge.schema({
  id: { type: String, key: true, generate: false },
  name: String
});

var userSchema = lounge.schema({
  email: { type: String, key: true, generate: false },
  company: { type: Company, index: true }
});

var company = new Company({ id: 'acme_inc.', name: 'Acme Inc.' });
var user = new User({ email: 'bob@gmail.com', company: company });
Here a lookup reference document will be created with key '$_ref_by_company_acme_inc.' and it will link to our User
document:{ "key": "bob@gmail.com" }
We can use User.findByCompany(company.id, ...) to get the User instance.This example probably doesn't make much sense in real world. Multiple users can be associated with the same company,
so we really should use the 'array' index type.var companySchema = lounge.schema({
  id: { type: String, key: true, generate: false },
  name: String
});

var userSchema = lounge.schema({
  email: { type: String, key: true, generate: false },
  company: { type: Company, index: true, indexType: 'array' }
});

var company = new Company({ id: 'acme_inc.', name: 'Acme Inc.' });
var user1 = new User({ email: 'bob@gmail.com', company: company });
var user2 = new User({ email: 'joe@outlook.com', company: company });
Here now the company lookup reference document will have contents:"keys": [
  "bob@gmail.com",
  "joe@outlook.com"
]
We can use User.findByCompany(company.id, ...) to get both User instances.Lean QueriesSometimes we may only be interested in the index key value(s), and we do not actually wish to get the target document(s)
and create the model instances. This can be accomplished using lean option:var userSchema = lounge.schema({
  name: String,
  email: { type: String, index: true }
});

// ...

User.findByEmail('joe@gmail.com', { lean: true }, function(err, rdoc) {
  console.log(rdoc); // '8bfda30c-604f-495c-a945-4c2e5ad123ad'
});
This also works with array types:var userSchema = lounge.schema({
  name: String,
  email: { type: String, index: true, indexType: 'array' }
});

// ...

User.findByEmail('joe@gmail.com', { lean: true }, function(err, rdoc) {
  console.log(rdoc); // [ '4c2e5ad1-604f-495c-a945-8bfda30c23ad', 'b81134d5-24ac-408b-b2d6-40a33a057f50' ]
});
And similarly with embedded documents:var companySchema = lounge.schema({
  name: String,
  address: String
});

Company = lounge.model('Company', companySchema);

var userSchema = lounge.schema({
  firstName: String,
  lastName: String,
  email: {type: String, key: true, generate: false},
  company: {type: Company, index: true}
});

User = lounge.model('User', userSchema);

// ...

User.findByCompany(companyId, { lean: true }, function(err, rdoc) {
  console.log(rdoc); // joe@gmail.com
});

events.html.body:
Events All model instances inherit EventEmitter, and
emit three events:index - when indexing of lookup document is successfully finished.

save - when the document was successfully saved.

remove - when the document was successfully removed.

error - when an error happened when performing an action.

All "success" event handers take arguments (document, options). document is the instance of document that the action was
performed on, and options are the options used for the action. When an 'error' event occurs the handler takes arguments
(error, document), where error is an Error instance and document is the document instance of the context.var userSchema = lounge.schema({
  name: String,
  email: { type: String, index: true }
});

var User = lounge.model('User', userSchema);
var user = new User({
  name: 'Bob Smith',
  email: 'bob@gmail.com'
});

user.on('index', function (doc) {
  console.log('indexed document: ' + doc.id);
});

user.on('remove', function (doc) {
  console.log('document removed');
});

user.on('save', function (doc) {
  console.log('document saved');
});
Similarly, the generated Model classes emit events when actions happen for any model instance of that type.var userSchema = lounge.schema({
  name: String,
  email: { type: String, key: true, generate: false }
});

var User = lounge.model('User', userSchema);

User.on('index', function (doc, options) {
  console.log('indexed User document: ' + doc.id);
});

User.on('save', function (doc, options) {
  console.log('saved User document: ' + doc.id);
});

User.on('remove', function (doc, options) {
  console.log('removed User document: ' + doc.id);
});

var user = new User({
  name: 'Bob Smith',
  email: 'bob@gmail.com'
});

user.save(); // prints 'saved User document: bob@gmail.com'
Finally, the lounge object itself is an instance of EventEmitter that emits events when actions happen
for any model instance of any type:lounge.on('index', function (doc, options) {
  console.log('indexed ' + doc.modelName + ' document: ' + doc.id);
});

lounge.on('save', function (doc, options) {
  console.log('saved ' + doc.modelName + ' document: ' + doc.id);
});

lounge.on('remove', function (doc, options) {
  console.log('removed ' + doc.modelName + ' document: ' + doc.id);
});

var userSchema = lounge.schema({
  name: String,
  email: { type: String, key: true, generate: false }
});

var User = lounge.model('User', userSchema);
var user = new User({
  name: 'Bob Smith',
  email: 'bob@gmail.com'
});

user.save(); // prints 'saved User document: bob@gmail.com'

promises.html.body:
Promises Lounge implements Promise support
using the Bluebird module for all async operations. We support callback-style and Promise-style API, but you should not mix and use both at the same time. If a callback is provided a promise is not returned and normal callback-style
control flow happens. If no callback is provided a promise is returned, of course you do not have to do anything with it if you do not care about the result of an operation. Resolved promises only return the first success result parameter, so
methods that would normally return more than 2 arguments via a callback (such as the missing argument in find*) lose that parameter when invoked promise-style. If you need that call the methods using callbacks. Promise support can be completely turned off using promisify configuration setting within the Lounge object. Simple example for ES6:const lounge = require('lounge');

const createUserSchema = () => {
  return lounge.schema({
    firstName: String,
    lastName: String,
    email: String
  });
};

const createUser = User => {
  return new User({
    firstName: 'Joe',
    lastName: 'Smith',
    email: 'joe@gmail.com'
  });
};

const connOpts = {
  connectionString: 'couchbase://127.0.0.1',
  bucket: 'lounge_test'
};

lounge.connect(connOpts)
  .then(createUserSchema)
  .then(schema => lounge.model('User', schema))
  .then(createUser)
  .then(user => user.save())
  .then((savedDoc) => {
    console.log(`User instance ${savedDoc.id} saved.`);
  }).catch(e => {
    console.error(e);
  });
With Babel we can use JavaScript features not available in Node yet, like async / await for async control.await lounge.connect({
  connectionString: 'couchbase://127.0.0.1',
  bucket: 'lounge_test'
});

const schema = lounge.schema({
  firstName: String,
  lastName: String,
  email: String
});

const User = lounge.model('User', schema);

const user = new User({
  firstName: 'Joe',
  lastName: 'Smith',
  email: 'joe@gmail.com'
});

const doc = await user.save();
console.log(`User instance ${doc.id} saved.`);
